import React from 'react';
import './PrixCdf.css';
import { doc, getDoc } from "firebase/firestore";
import { db } from '../../firebase';

// Return PrixCdf Component 
export default function ReturnPrixCdf() {

 const [prix, setPrix] = React.useState(null);

 React.useEffect(async () => {

  const docRef = doc(db, "ungama", "money");
  const docSnap = await getDoc(docRef);
  if (docSnap.exists()) {
   setPrix(docSnap.data().allcdf);
  };

 }, []);

 return (
  <div className='wrp-prixcdf-all'>
   <h1>{prix}</h1>
   <span>CDF</span>
  </div>
 );
};
